import React, { useState } from 'react';
import forge from 'node-forge';

const App = () => {
 const [inputText, setInputText] = useState('');
  const [encryptedText, setEncryptedText] = useState('');

  const encryptText = () => {
    // Generate Diffie-Hellman keys
    const diffieHellman = crypto.createDiffieHellman(256);
    const publicKey = diffieHellman.generateKeys('base64');

    // Perform encryption
    const cipher = crypto.createCipher('aes-256-cbc', publicKey);
    let encrypted = cipher.update(inputText, 'utf8', 'hex');
    encrypted += cipher.final('hex');

    setEncryptedText(encrypted);
  };

  return (
    <div>
      <input
        type="text"
        value={inputText}
        onChange={(e) => setInputText(e.target.value)}
      />
      <button onClick={encryptText}>Encrypt</button>
      <div>{encryptedText}</div>
    </div>
  );
};

export default App;
